import React, { FC } from 'react';

interface NavigationProps {
  title: string;
}

const Navigation: FC<NavigationProps> = ({ title }) => {
  return (
    <div className="justify-between mx-auto underline text-3x1">
      <h1 className="underline"><a href="resume.pdf" target="_blank" download>{title}</a></h1>
      <h1>{title}</h1>
      <h1>{title}</h1>
      <h1>{title}</h1>
    </div>
  );
};

export default Navigation;
